"        1715267",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Levien TL and Baker DE, &ldquo;Reviews of Acrivastine and Midotrine,&rdquo;",
"      <i>",
