var title_f30_59_31674="Photomicrograph of urine sediment with white blood cells";
var content_f30_59_31674=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F75211%7ENEPH%2F54319%7ENEPH%2F68147%7ENEPH%2F59811%7ENEPH%2F65483&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F75211%7ENEPH%2F54319%7ENEPH%2F68147%7ENEPH%2F59811%7ENEPH%2F65483&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Photomicrograph of urine sediment with white blood cells",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    White blood cells in the urine sediment with nuclei and granular cytoplasm.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Frances Andrus, BA, Victoria Hospital, London, Ontario.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Photomicrograph of urine sediment with white blood cell cast (I)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 247px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    White cell cast in which blue stained white cells (arrow) are contained within a granular cast.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Frances Andrus, BA, Victoria Hospital, London, Ontario.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Photomicrograph of urine sediment with white blood cell cast (II)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 236px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A white blood cell cast, three-quarters of which is filled with leukocytes.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Frances Andrus, BA, Victoria Hospital, London, Ontario.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Granular and waxy casts",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 375px; height: 251px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Urine sediment showing waxy and fine and coarse (arrow) granular casts. The broader casts are thought to form when there is stasis (due to advanced renal failure) in the wider collecting tubules into which many nephrons drain.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Harvard Medical School.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Waxy cast",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 269px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Urine sediment showing a waxy cast (arrow) and many small fine granular casts. Note the cast outline and its amorphous appearance. The high optical density, smooth surface, and blunt ends of waxy casts, which appear to represent degenerated cellular or granular casts, allows them to be distinguished from hyaline casts. The latter are composed solely of precipitated Tamm-Horsfall mucoprotein.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Frances Andrus, BA, Victoria Hospital, London, Ontario.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
