var title_f30_59_31676="Infection risk of blood products";
var content_f30_59_31676=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F69661&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F69661&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk of viral and bacterial infection following transfusion of blood products",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Whole blood or red blood cell products*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatitis B",
"       </td>",
"       <td>",
"        1:58,000 to 1:269,000 (see note below for 2012 estimates)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatitis C",
"       </td>",
"       <td>",
"        1:1,000,000 to 1:2,000,000",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HTLV",
"       </td>",
"       <td>",
"        1:1,900,000",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HIV",
"       </td>",
"       <td>",
"        1:1,500,000 to 1:2,000,000",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Solvent/detergent-treated plasma products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatitis C",
"       </td>",
"       <td>",
"        Inactivated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatitis B",
"       </td>",
"       <td>",
"        Inactivated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HIV",
"       </td>",
"       <td>",
"        Inactivated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatitis A",
"       </td>",
"       <td>",
"        Not inactivated",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Parvovirus B19",
"       </td>",
"       <td>",
"        Not inactivated",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Platelet products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        With automated bacterial culturing methods in place, septic transfusion reactions are estimated to occur at a rate of 1:50,000 transfused platelet apheresis units. This is an underestimate, since it relies on passive surveillance data.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Cytomegalovirus (CMV) infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        The risk of CMV infection is rare in recipients with selected conditions (eg, bone marrow or solid organ transplants) who are at risk for severe morbidity from CMV infection and who receive CMV reduced risk products. Two methods to supply CMV reduced risk products that appear to have equal efficacy are: CMV seronegative cellular components (red cells, platelets)",
"        <strong>",
"         or",
"        </strong>",
"        leukoreduced components.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Numbers reported in this table are",
"    <strong>",
"     estimates",
"    </strong>",
"    derived from multiple sources within the United States, where blood is routinely screened for infection with syphilis, hepatitis B and C, HIV-1, HIV-2, HTLV-I, HTLV-II, and West Nile Virus. CMV serotesting is not routine; only enough products are tested to provide a sufficient inventory of CMV-negative products. See relevant sections of the text for details and references.",
"    <div class=\"footnotes\">",
"     * Estimates of the risk of transmitting a viral infection by transfusion in the United States in 2010. These estimates still appear to be valid in 2012, with the exception of HBV where the risk is estimated to have diminished to one in 205,000 to one in 355,000.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      Plasma products are tested for Parvovirus B19 and HAV nucleic acid before being used for further manufacturing into S/D plasma. Transmission of these agents should not occur under these conditions.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
